import React, { Component } from 'react'
import { connect } from 'react-redux'
import ToddlerFilter from '../components/toddlercomp/ToddlerFilter'

class ToddlerContainer extends Component {
    render() {
        console.log(this.props.geToddler, "Toddler Container")
        return (
            <div>
                <ToddlerFilter getToddlers={this.props.allDaycares}/>
            </div>
        )
    }
}

const mapStateToProps = state => {
    // console.log(state)
    return {
        allDaycares: state.daycareReducer.daycares,
        loading: state.loading
    }
}

export default connect(mapStateToProps)(ToddlerContainer)
